import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import CardList from './CardList';
import { robots } from './robots.js';
// import {
//   MDBContainer,
//   MDBRow,
//   MDBCol,
